import React, { Component } from "react";
import { GridList, Grid } from "@material-ui/core";

class Cart extends Component {
  render() {
    return (
      <div>
        <h2>Cart</h2>
        <GridList
          cellHeight={200}
          style={{ marginRight: 100, marginLeft: 100 }}
          cols={1}
        >
          {["red", "yellow", "blue"].map(color => (
            <div justify="flex-start" style={{ background: color }}></div>
          ))}
        </GridList>
      </div>
    );
  }
}

export default Cart;

